3/3 ^Lara

@TimCoxonPGA Sorry to hear you're having trouble accessing your account.
We'd need you to get in touch with our Share dealing team to allow them to investigate this further. 
You can call them on 0345 606 0560, they can also assist with any account queries when you speak to them.

@AhmadNa12194301 Hi, I'm David. Thanks for getting in touch.

